import React from 'react'
import "./post.css"

// export default function Post(props) {
//   return (
//     <div className='post' style={{backgroundColor:props.color}}>
//         <p id="titel">{props.titel} </p>
//         <p id="info">{props.info} </p>
        

//     </div>
//   )
// }

function MyComponent() {
  return (
    <div>
      <div className="chat-header">
        <i className="whatsapp-icon fab fa-whatsapp"></i>
        SVCollege </div>
      <div className="chat-body">
        <div className="message">
          <p className="message-text">מאיר חדד</p>
          <span className="message-date">נפל החיבור לזום</span><br/>
          <span className="message-text">May 1, 2023  18:26</span>
          <p className="message-text">איתן מרצה</p>
          <span className="message-date">נפל החשמל.. אנא המתן </span><br/>
          <span className="message-date">May 1, 2023   18:26</span>
          <p className="message-text">נועה אסרף</p>
          <span className="message-date">אתם בפינת עישון ?</span><br/>
          <span className="message-date">May 1, 2023   18:40</span>
          <p className="message-text">אופק פאטריק</p>
          <span className="message-date">כן</span><br/>
          <span className="message-date">May 1, 2023   18:41</span>
        </div>
      </div>
      <input className="new-message-input" type="text" placeholder="Type a message..." />
    </div>
  );
}

export default MyComponent;
